import React from "react";

class Ride extends React.Component {

  constructor(props){
    super(props)
  }

  render() {
    console.log("%c this.props", this.props, "color: blue")
    return (
      <div>
        <p>Distance:{this.props.ride.distance}</p>
        <p>Price: {this.props.ride.price}</p>
        <p>Started At: {this.props.ride.started_at}</p>
        <p>Ended At:{this.props.ride.ended_at}</p>
        <p>Start Location: {this.props.ride.start_location}</p>
        <p>End Locatoin: {this.props.ride.end_location}</p>
      </div>
    )
  }
}
export default Ride
